  "text" : "\uC0C1\uB300\uAC00 \uC220 \uBABB\uB9C8\uC2E0\uB2E4\uACE0 \uD558\uBA74 \uBC18\uC794\uB9CC \uB530\uB77C\uC8FC\uAC70\uB098 \uC544\uB2C8\uBA74 \uC0AC\uC774\uB2E4 \uB530\uB77C\uC8FC\uACE0, \uADF8 \uC794\uC73C\uB85C \uACC4\uC18D \uBC84\uD168\uB3C4 \uC2E0\uACBD \uC548\uC4F0\uB294 \uD3B8.\n\n\uC220 \uBABB\uBA39\uB294\uB2E4\uB294 \uC0AC\uB78C\uC5D0\uAC8C \uC5B5\uC9C0\uB85C \uC220\uBA39\uC5EC\uC11C \uBB50\uD558\uACA0\uB098. \uB4B7\uAC10\uB2F9 \uD558\uAE30\uB9CC \uD798\uB4E4\uC9C0. \uBCF4\uD1B5\uC740 \uB05D\uAE4C\uC9C0 \uBA40\uCA61\uD558\uAC8C \uC0B4\uC544\uB0A8\uB294 \uD3B8\uC774\uB77C, \uB4B7\uCC98\uB9AC\uB294 \uC9C4\uC800\uB9AC\uAC00 \uB098..",
