  "text" : "\uC800\uC640 \uC220\uC744 \uB9C8\uC154\uBCF8 \uBD84\uB4E4\uC774 \uD2B8\uC717\uC5D0\uB3C4 \uC880 \uC788\uB294\uB370, \uC544\uC2DC\uB2E4\uC2DC\uD53C \uC800\uB791 \uC220 \uB9C8\uC2DC\uBA74 \uD504\uB9AC\uC2A4\uD0C0\uC77C \uB4DC\uB9C1\uD0B9\uC774 \uB418\uC8E0. \uC5B5\uC9C0\uB85C \uC220 \uB530\uB77C\uC8FC\uB294 \uAC83\uB3C4 \uC5C6\uACE0, \uBA39\uC73C\uB77C\uACE0 \uAD8C\uD558\uC9C0\uB3C4 \uC54A\uACE0, \uADF8\uB0E5 \uBA39\uACE0 \uC2F6\uC73C\uBA74 \uBA39\uACE0 \uADF8\uB7F0\uAC83\uC784. \uC2EC\uC9C0\uC5B4\uB294 \uC81C \uC220\uC740 \uC81C\uAC00 \uC790\uC791. \uC5B5\uC9C0\uB85C \uC220 \uBA39\uC774\uB294\uAC70 \u3134\u3134\uD574..",
