  "text" : "DOMA\uAC00 \uBBF8 \uC5F0\uBC29\uD5CC\uBC95\uC0C1 \"\uC5F0\uBC29\uC8FC\uC758\"\uC5D0 \uC758\uD574 \uBCF4\uC7A5\uB418\uB294 \uC8FC\uC758 \uC8FC\uAD8C\uC744 \uCE68\uD574\uD558\uC600\uC73C\uBBC0\uB85C \uC5F0\uBC29\uC8FC\uC758\uC5D0 \uBC18\uD558\uC5EC \uC704\uD5CC\uC774\uB77C\uACE0 \uD310\uB2E8\uD588\uC2B5\uB2C8\uB2E4. \/ \uC880 \uC26C\uC6B4 \uC608\uB97C \uB4E4\uC5B4\uBCF8\uB2E4\uBA74(\uC801\uD655\uD55C \uC608\uC2DC\uB294 \uC544\uB2D9\uB2C8\uB2E4) \uD574\uB2F9 \uC18C\uC1A1\uC774 \uC6B0\uB9AC\uB098\uB77C\uC5D0\uC11C \uC788\uC5C8\uB2E4\uBA74 \uD5CC\uBC95\uC7AC\uD310\uC18C\uAC00 \uC774\uB97C \"\uD3C9\uB4F1\uAD8C \uC704\uBC18\"\uC774 \uC544\uB2CC",
