  "text" : "\uBBF8 \uC5F0\uBC29 \uACB0\uD63C\uBCF4\uD638\uBC95(Defense of Marriage Act, \uC774\uD558 DOMA)\uC740 \uACB0\uD63C\uD55C \uBD80\uBD80\uC758 \uC138\uAE08, \uBCF4\uAC74, \uC8FC\uD0DD \uB4F1\uC758 \uD61C\uD0DD\uC5D0 \uB300\uD574 \uADDC\uC815\uD55C \uBC95\uB960\uC785\uB2C8\uB2E4. \uADF8\uB7F0\uB370 \uC774 DOMA\uAC00 \uB17C\uB780\uC774 \uB41C \uC774\uC720\uB294 \uACB0\uD63C\uC744 '\uC774\uC131\uAC04\uC758 \uACB0\uD569'\uC774\uB77C\uACE0 \uC815\uC758\u00B7\uADDC\uC815\uD55C \uAC83\uC5D0 \uC788\uC5C8\uC8E0.",
