  "text" : "\uBC95\uC6D0\uC740 \uC0AC\uBC95\uBD80\uC774\uACE0, \uAC80\uCC30\uC740 \uBC95\uBB34\uBD80, \uACBD\uCC30\uC740 \uC548\uC804\uD589\uC815\uBD80 \uC18C\uC18D\uC785\uB2C8\uB2E4.\n\n\uADF8\uB9AC\uACE0 \uD5CC\uBC95\uC7AC\uD310\uC18C\uC640 \uC911\uC559\uC120\uAC70\uAD00\uB9AC\uC704\uC6D0\uD68C\uB294 \uC785\uBC95\uBD80\u00B7\uC0AC\uBC95\uBD80\u00B7\uD589\uC815\uBD80 \uADF8 \uC5B4\uB514\uC5D0\uB3C4 \uC18D\uD558\uC9C0 \uC54A\uB294 \uD5CC\uBC95\uC0C1 \uB3C5\uB9BD\uAE30\uAD00\uC774\uC5D0\uC694. \uADF8\uB798\uC11C \uD5CC\uBC95\uC740 \uD5CC\uC7AC\uC640 \uC120\uAD00\uC704\uB97C \uC81C6\uC7A5\uACFC \uC81C7\uC7A5\uC5D0\uC11C \uB530\uB85C \uADDC\uC815\uD558\uACE0 \uC788\uAD6C\uC694.",
