  "text" : "\uC800\uC791\uAD8C \uCE68\uD574\uC2DC \uBC95\uBB34\uBC95\uC778\uC774 \uC81C\uC2DC\uD558\uB294 \uD569\uC758\uAE08\uC758 \uC561\uC218\uB97C \uBCF4\uACE0 \uAE30\uAC81\uD558\uB294 \uACBD\uC6B0\uAC00 \uC885\uC885 \uC788\uB294\uB370.. \uCF00\uBC14\uCF00\uC774\uAE34 \uD558\uACA0\uC9C0\uB9CC, \uC880 \u314E\u3137\u3137 \uD560 \uB54C\uAC00 \uB9CE\uAE34 \uD558\uC8E0. \uC800\uC791\uAD8C \uCE68\uD574\uAC00 \uCD08\uBC94\uC774\uACE0, \uACBD\uBBF8\uD55C \uCE68\uD574\uC77C \uACBD\uC6B0\uC5D0\uB294 '\uAD50\uC721\uC870\uAC74\uBD80 \uAE30\uC18C\uC720\uC608\uC81C'\uB780\uAC8C \uC788\uC2B5\uB2C8\uB2E4. \uB0B4\uAC00 \uC120\uD0DD\uD558\uB294\uAC74 \uC544\uB2D8.",
