  "text" : "\uADF8\uB7EC\uACE0\uBCF4\uB2C8 \uC624\uB298\uC774 \uC0AC\uBC95\uC2DC\uD5D8 2\uCC28 \uC2DC\uD5D8 \uC2DC\uC791\uC77C\uC774\uB124. \uC5BC\uB9C8 \uB0A8\uC9C0 \uC54A\uC740 \uBC95\uC870\uACC4\uC758 '\uC131\uACE8' \uC790\uB9AC\uB97C \uB450\uACE0 \uACBD\uC7C1\uC774 \uCE58\uC5F4\uD558\uAD6C\uB098..\n\n\uC5ED\uC0AC\uC5D0\uC11C \uC131\uACE8\uC774 \uACB0\uAD6D\uC740 \uC9C4\uACE8\uC5D0\uAC8C \uC655\uC704\uB97C \uB0B4\uC8FC\uC5C8\uC9C0\uB9CC, \uADF8\uB798\uB3C4 \uC131\uACE8\uC774 \uC0AC\uB77C\uC9C0\uAE30 \uC804\uAE4C\uC9C0\uB294 \uC544\uB2C8\uC5C8\uC74C. \uC9C0\uAE08\uB3C4 \uBE44\uC2B7\uD55C \uC0C1\uD669\uC774 \uB418\uC9C0 \uC54A\uC744\uAE4C..",
