  "text" : "\uC65C \uAC1C\uC778\uC758 \uBB38\uC81C\uB97C \uC18C\uC18D \uC9D1\uB2E8- \uADF8\uAC83\uB3C4 \uC790\uC2E0\uC774 \uC120\uD0DD\uD574\uC11C \uB4E4\uC5B4\uAC04 \uAC83\uB3C4 \uC544\uB2CC \uC9D1\uB2E8 \uC804\uCCB4\uC758 \uBB38\uC81C\uB85C \uB9E4\uB3C4\uD558\uB294\uC9C0 \uBAA8\uB974\uACA0\uB124.. \uD3C9\uC0DD \uC131\uB9E4\uB9E4 \uD55C\uBC88 \uC548\uD574\uBCF4\uACE0 \uC0B4\uC544\uAC00\uB294 \uB0A8\uC790\uB4E4\uB3C4 \uC5BC\uB9C8\uB098 \uB9CE\uC740\uB370, \uB300\uB738 \"\uB0A8\uC790\uB4E4 \uB2E4\uB4E4 \uADF8\uB807\uC796\uC544?\" \uB77C\uB294 \uC18C\uB9AC \uB4E4\uC73C\uBA74 \uCC38\uC73C\uB85C \uBD88\uCF8C\uD558\uAE30 \uADF8\uC9C0\uC5C6\uB2E4.",
