  "text" : "\uC5EC\uD2BC, \uC131\uD3ED\uB825 \uBC94\uC8C4 \uD53C\uD574\uC790\uC758 \uD2B8\uB77C\uC6B0\uB9C8\uB97C \uC815\uB7C9\uD654 \uD55C\uB2E4\uB294 \uAC83\uC740 \uC815\uB9D0\uB85C \uC5B4\uB824\uC6B4 \uBB38\uC81C\uC785\uB2C8\uB2E4. \uC194\uC9C1\uD788 \uB9D0\uD574 \uBD88\uAC00\uB2A5\uD558\uC9C0 \uC54A\uC744\uAE4C \uC2F6\uAE30\uB3C4 \uD55C \uAC83\uC774 \uC0AC\uC2E4\uC774\uAE34 \uD574\uC694. '\uAC1C\uAC1C\uC778\uC758 \uBA58\uD0C8\uC758 \uAC15\uB3C4(?)\uAC00 \uBAA8\uB450 \uCC9C\uCC28\uB9CC\uBCC4\uC77C\uD150\uB370, \uADF8\uAC8C \uC815\uB7C9\uD654\uAC00 \uAC00\uB2A5\uD55C\uAC00?' \uB77C\uB294 \uC758\uBB38\uC774 \uB4DC\uB2C8\uAE4C\uC694.",
