  "text" : "\uC544 \uB9DE\uB2E4.. \uAC11\uC790\uAE30 \uC0DD\uAC01\uB09C\uAC74\uB370, \uC6B0\uB9AC\uB098\uB77C\uC5D0\uC11C \uC77C\uBC18 \uB300\uC911\uB4E4\uC774 '\uC131\uBC94\uC8C4\uC5D0 \uB300\uD55C \uD615\uB7C9\uC774 \uB108\uBB34 \uB0AE\uB2E4'\uACE0 \uB290\uB07C\uAC8C \uB418\uB294 \uD310\uACB0\uB4E4 \uC911\uC5D0 \uAF64 \uB9CE\uC740 \uD310\uACB0\uC774 '\uAC00\uD574\uC790\uC640 \uD53C\uD574\uC790\uAC00 \uD569\uC758\uD55C \uC810\uC744 \uCC38\uC791\uD574' \uD615\uC744 \uC120\uACE0\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uC5B8\uB860\uC5D0\uC11C\uB294 \uC5EC\uAE30\uAE4C\uC9C0\uB294 \uC798 \uBCF4\uB3C4\uD558\uC9C0 \uC54A\uB294 \uB4EF..",
