  "text" : "\uBD88\uC2E0\uD560 \uC218 \uBC16\uC5D0 \uC5C6\uAC8C \uB418\uACA0\uC8E0. \uC870\uAE08 \uC218\uACE0\uC2A4\uB7FD\uB354\uB77C\uB3C4 \uCC28\uBD84\uD558\uAC8C \uD480\uC5B4\uAC00\uBA70 \uC124\uBA85\uD558\uACE0 \uC774\uD574\uC2DC\uD0A4\uB824 \uB178\uB825\uD558\uBA74, \uBE44\uBC95\uC804\uACF5\uC790\uB4E4\uB3C4 \uCDA9\uBD84\uD788 \uBC95\uC801\uC774\uACE0 \uC774\uC131\uC801\uC778 \uC811\uADFC\uC774 \uAC00\uB2A5\uD55C\uB370 \uB9D0\uC774\uC5D0\uC694. \uC131\uBC94\uC8C4\uB97C \uBE44\uB86F\uD55C \uAC01\uC885 \uBC94\uC8C4\uC640 \uC0AC\uBC95\uBD80\uC758 \uD310\uB2E8\uC5D0 \uB300\uD574 \uAD6D\uBBFC\uB4E4\uC774 \uAC10\uC815\uC801\uC73C\uB85C \uC811\uADFC\uC744 \uD558\uAC8C \uB418\uACE0",
