  "text" : "\uD560 \uD544\uC694\uAC00 \uC788\uACA0\uC8E0. '\uC774 \uC0AC\uC548\uC740 \uC5B4\uB5A0\uC5B4\uB5A0\uD574\uC11C \uC774\uB7EC\uC774\uB7EC\uD558\uAC8C \uD310\uB2E8\uD558\uAC8C \uB418\uC5C8\uB2E4' \uB77C\uB358\uAC00, '\uC774 \uC0AC\uC548\uC740 \uC800\uB7EC\uC800\uB7EC\uD574\uC11C \uADF8\uB7EC\uADF8\uB7EC\uD55C \uC810\uC744 \uBC30\uC81C\uD558\uC600\uB2E4' \uB4F1\uB4F1\uC744 \uD655\uC2E4\uD558\uAC8C \uB300\uC911\uB4E4\uC5D0\uAC8C \uD64D\uBCF4\uD558\uC9C0 \uC54A\uC73C\uB2C8, \uC804\uBB38\uC801\uC778 \uBC95\uC801 \uC9C0\uC2DD\uC774 \uBD80\uC871\uD560 \uC218 \uBC16\uC5D0 \uC5C6\uB294 \uB9CE\uC740 \uB300\uC911\uB4E4\uC740 \uC0AC\uBC95\uBD80\uB97C",
