  "text" : "\uC774\uB7EC\uD55C \uD310\uB2E8\uC744 \uB0B4\uB9B0 \uC7AC\uD310\uBD80\uC5D0 \uB300\uD574 \uC5B8\uB860\uC744 \uBE44\uB86F\uD55C \uC5EC\uB860\uB4E4\uC740 \uC5C4\uCCAD\uB09C \uBE44\uD310\uC744 \uD588\uACE0, \uC2EC\uC9C0\uC5B4\uB294 \uBC95\uD559\uACC4 \uBC0F \uBC95\uC870\uACC4\uC5D0\uC11C\uB3C4 \uD310\uACB0\uC5D0 \uB300\uD574 \uC774\uB860\uC774 \uBD84\uBD84\uD588\uC5C8\uC2B5\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uADF8 \uBE44\uD310\uC758 \uB0B4\uC6A9\uC5D0\uB294 \uCC28\uC774\uAC00 \uC788\uC5C8\uC2B5\uB2C8\uB2E4. \uC608\uC0C1\uD558\uC168\uB2E4\uC2DC\uD53C \uC5EC\uB860\uC758 \uC785\uC7A5\uC740 \"\uC544\uB2C8 \uADF8\uAC8C \uC65C \uC0B4\uC778\uC774\uB0D0,",
