  "text" : "\uC0AC\uD615\uC758 \uC9D1\uD589\uC740 \uAC80\uC0AC\uC758 \uC9C0\uD718\uB97C \uBC1B\uC544(\uC790\uC720\uD615\uB4F1\uC5D0 \uAD00\uD55C \uAC80\uCC30\uC9D1\uD589\uC0AC\uBB34\uADDC\uCE59) \uC77C\uBC18\uC801\uC73C\uB85C \uD574\uB2F9 \uC0AC\uD615\uC218\uAC00 \uC218\uD615\uB418\uC5B4 \uC788\uB294 \uAD50\uB3C4\uC18C\uC758 \uAD50\uB3C4\uAD00\uB4E4\uC774 \uD558\uAC8C \uB429\uB2C8\uB2E4. \uADFC\uB370 \uAD50\uB3C4\uAD00\uB4E4\uC774 \uC0AC\uD615\uC9D1\uD589 \uCC38\uC5EC\uB97C \uC0C1\uB2F9\uD788 \uAEBC\uB824\uD55C\uB2E4\uB124\uC694. \uADF8\uB798\uC11C \uC0AC\uD615\uC9D1\uD589\uC778\uC740 \uAD50\uB3C4\uAD00 \uC911\uC5D0\uC11C \uBB34\uC791\uC704 \uCC28\uCD9C\uD558\uAC8C \uB418\uACE0,",
