  "text" : "6. \uBAA9\uC5D0 \uBC27\uC904\uC744 \uAC74\uB2E4.\n\n7. \uC2A4\uC704\uCE58\uB098 \uB808\uBC84\uB97C \uB20C\uB7EC \uBC1C\uD310\uC774 \uB0B4\uB824\uAC00\uAC8C \uD55C\uB2E4. \uB300\uD55C\uBBFC\uAD6D\uACFC \uC77C\uBCF8\uC740 3~5\uBA85\uC774 \uB3D9\uC2DC\uC5D0 \uC2A4\uC704\uCE58\uB97C \uB204\uB974\uBA74 \uBC1C\uD310\uC774 \uB0B4\uB824\uAC00\uAC8C \uB418\uC5B4\uC788\uB2E4.\n\n8. \uC77C\uC815 \uC2DC\uAC04(\uD55C\uAD6D\uC740 30\uBD84) \uACBD\uACFC \uD6C4 \uC758\uC0AC\uAC00 \uC0AC\uB9DD\uC744 \uD655\uC778\uD55C \uB4A4 \uD53C\uD615\uC790\uC758 \uC2DC\uC2E0\uC744 \uB04C\uC5B4\uB0B4\uB9B0\uB2E4.",
