  "text" : "\uAD50\uC218\uD615\uC5D0 \uCC98\uD574\uC9C0\uB294 \uC0AC\uD615\uC218\uAC00 \uACE0\uD1B5 \uC5C6\uC774 \uC0AC\uB9DD\uC5D0 \uC774\uB97C \uC218 \uC788\uB3C4\uB85D \uD558\uAE30 \uC704\uD574, \uAC01 \uAD50\uB3C4\uC18C\uC5D0\uB294 \uC0AC\uD615\uC218\uC758 \uCCB4\uC911\uACFC \uD0A4\uC5D0 \uB530\uB978 \uBC27\uC904 \uAE38\uC774, \uB099\uD558 \uB192\uC774 \uB4F1\uC744 \uACF5\uC2DD\uD654 \uD55C \uB9E4\uB274\uC5BC\uC774 \uBE44\uCE58\uB418\uC5B4 \uC788\uC73C\uBA70, \uC774\uB7EC\uD55C \uC0AC\uD615 \uC9D1\uD589 \uB9E4\uB274\uC5BC\uC5D0 \uB530\uB77C \uAD50\uC218\uD615\uC744 \uC9D1\uD589\uD558\uAC8C \uB429\uB2C8\uB2E4.",
