  "text" : "\uB0B4\uAC00 \uC608\uBED0\uD558\uB294 \uB3D9\uC0DD\uC774 \uC6B8\uB4EF\uD55C \uBAA9\uC18C\uB9AC\uB85C \uC804\uD654\uB97C \uD588\uB2E4. \uC5B4\uC82F\uBC24 \uC220\uC790\uB9AC\uC5D0\uC11C \uAD6C\uB0A8\uCE5C\uC774 \uD734\uB300\uD3F0\uC744 \uBAB0\uB798 \uAC00\uC838\uAC00\uC11C \uC800\uC7A5\uB41C \uC8FC\uC18C\uB85D\uC744 \uBE7C\uB0B4\uAC14\uACE0, \uC8FC\uC18C\uB85D\uC5D0 \uC788\uB294 \uC0AC\uB78C\uB4E4\uC5D0\uAC8C \uC628\uAC16 \uC0C1\uC2A4\uB7EC\uC6B4 \uB9D0\uACFC \uC790\uC2E0\uC5D0 \uB300\uD55C \uBAA8\uC695\uC801 \uB0B4\uC6A9\uC774 \uB2F4\uAE34 \uBA54\uC2DC\uC9C0\uB97C \uC804\uB2EC\uD588\uB294\uB370 \uC774\uAC70 \uC5B4\uB5BB\uAC8C \uD574\uC57C \uD558\uB0D0\uACE0.",
