  "text" : "\uC774 \uD611\uC57D\uC774 \uC5B4\uB5A4 \uBD84\uB4E4\uC5D0\uAC8C\uB294 \uAD6C\uC5ED\uC9C8\uB098\uB294 \uB0B4\uC6A9\uC774 \uB420 \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4. \"\uC6B0\uB9AC\uD3B8\uC744 \uC8FD\uC600\uB294\uB370, \uC800\uB188\uB4E4\uC5D0\uAC8C \uB300\uCCB4 \uC778\uAD8C\uC774 \uC5B4\uB528\uB0D0\" \uB77C\uACE0 \uB9D0\uC774\uC9C0\uC694. \uADF8\uB7F0\uB370 \uBC09\uB2E4\uACE0 \uD3EC\uB85C\uB4E4\uC744 \uB9C9 \uC3F4\uC8FD\uC774\uACE0 \uADF8\uB7EC\uC796\uC544\uC694? \uADF8\uB7FC \uC804\uC7C1\uBC94\uC8C4\uC790\uAC00 \uB429\uB2C8\uB2E4. \uD558\uC9C0\uB9CC \uADF8\uAC8C \uC815\uC758\uB77C\uB294 \uBD84\uB4E4\uB3C4 \uACC4\uC2E4\uAEBC\uC5D0\uC694.",
