  "text" : "\uC870\uB450\uC21C \uC0AC\uAC74\uC5D0\uC11C\uB3C4 \uC5C4\uBC8C\uC8FC\uC758 \uBC0F \uADF9\uD615\uC5D0 \uB300\uD55C \uB450\uB824\uC6C0 \uB54C\uBB38\uC5D0 \uC870\uB450\uC21C\uC774 \uBC94\uC8C4\uB97C \uC740\uD3D0\uD558\uACE0\uC790 \uC774\uB7F0 \uC800\uB7F0 \uAC00\uD639\uD589\uC704\uB97C \uD55C \uD0D3\uC5D0, \uD53C\uD574\uC544\uB3D9\uC740 \uC131\uAE30\uC640 \uD56D\uBB38\uC758 80%\uB97C \uC0C1\uC2E4\uD574 \uC778\uACF5\uD56D\uBB38\uC744 \uCC29\uC6A9\uD574\uC57C \uD558\uB294 \uC601\uAD6C \uC7A5\uC560\uB97C \uC785\uAC8C \uB418\uC5C8\uC8E0. \uBC94\uC8C4\uB97C \uC800\uC9C0\uB974\uC9C0 \uC54A\uC740 \uAC83\uC774 \uC544\uB2C8\uB77C \uB9D0\uC774\uC5D0\uC694",
