  "text" : "\uC544\uCCAD\uBC95 \uB4F1\uC758 \uB17C\uB780\uC744 \uBCF4\uB2E4\uBCF4\uBA74 \uC131\uC778\uC774 \uD1A0\uB80C\uD2B8 \uB4F1\uC744 \uD1B5\uD574 \uC57C\uB3D9\uC744 \uB2E4\uC6B4\uBC1B\uC544 \uBCF4\uB294 \uAC83\uC740 \uD589\uBCF5\uCD94\uAD6C\uC758 \uC77C\uD658\uC774\uACE0 \uC5B4\uCA4C\uACE0 \uC800\uCA4C\uACE0 \uD558\uBA74\uC11C \uAD6D\uAC00\uAC00 \uC65C \uAC70\uAE30\uC5D0 \uAC04\uC12D\uD558\uB0D0\uACE0 \uD558\uC2DC\uB294 \uBD84\uB4E4\uC774 \uD754\uD788 \uBAA9\uACA9\uB418\uC8E0.\n\n\uADFC\uB370, \uADF8\uB7F0\uAC70 \uB2E4 \uC778\uC815\uD574\uB3C4 \uC57C\uB3D9 \uB2E4\uC6B4\uB85C\uB4DC\uB294 \uC800\uC791\uAD8C\uC758 \uCE68\uD574\uC785\uB2C8\uB2E4...?",
