  "text" : "\uC0C1\uC138\uD55C \uC124\uBA85\uC744 \uD568\uC73C\uB85C\uC368 \uC758\uB8B0\uC778\uC774 \uADF8 \uD544\uC694\uC131\uC774\uB098 \uC704\uD5D8\uC131\uC744 \uCDA9\uBD84\uD788 \uBE44\uAD50\uD574 \uBCF4\uACE0 \uADF8 \uC2DC\uC220\uC744 \uBC1B\uC744 \uAC83\uC778\uC9C0\uB97C \uC120\uD0DD\uD560 \uC218 \uC788\uB3C4\uB85D \uD560 \uC758\uBB34\uAC00 \uC788\uB2E4. \uD2B9\uD788 \uC758\uC0AC\uB85C\uC11C\uB294 \uC2DC\uC220\uD558\uACE0\uC790 \uD558\uB294 \uBBF8\uC6A9\uC131\uD615 \uC218\uC220\uC774 \uC758\uB8B0\uC778\uC774 \uC6D0\uD558\uB294 \uAD6C\uCCB4\uC801 \uACB0\uACFC\uB97C \uBAA8\uB450 \uAD6C\uD604\uD560 \uC218 \uC788\uB294 \uAC83\uC774 \uC544\uB2C8\uACE0",
