  "text" : "\uC774\uB7EC\uD55C \uC785\uBC95\uC790\uC758 \uD310\uB2E8\uC740, \uAD6D\uAC00\uB97C \uBCF4\uC704\uD558\uAE30 \uC704\uD55C \uCD5C\uC801\uC758 \uC804\uD22C\uB825\uC744 \uD56D\uC0C1 \uC720\uC9C0\uD574\uC57C \uD55C\uB2E4\uB294 \uAD6D\uBC29\uC758\uBB34 \uBD80\uACFC\uC758 \uC785\uBC95\uBAA9\uC801\uC5D0 \uBE44\uCD94\uC5B4 \uBCFC \uB54C, \uD2B9\uD788 \uC815\uC804 \uC0C1\uD0DC\uC5D0 \uC788\uB294 \uC138\uACC4 \uC720\uC77C\uC758 \uBD84\uB2E8\uAD6D\uAC00\uB85C\uC11C \uC804\uBA74\uC801\uC774\uAC74 \uAD6D\uC9C0\uC801\uC774\uAC74 \uB0A8\uBD81\uAC04\uC758 \uBB34\uB825\uCDA9\uB3CC \uAC00\uB2A5\uC131\uC774 \uD604\uC7AC\uAE4C\uC9C0\uB3C4 \uC0C1\uC874\uD558\uC5EC",
