  "text" : "\uC7A5\uC560\uAC00 \uC788\uC744 \uC218 \uC788\uACE0, \uC784\uC2E0\uC911\uC774\uAC70\uB098 \uCD9C\uC0B0 \uD6C4 \uC77C\uC815\uD55C \uAE30\uAC04\uC740 \uC704\uC0DD \uBC0F \uC790\uB140\uC591\uC721\uC758 \uD544\uC694\uC131\uC5D0 \uBE44\uCD94\uC5B4 \uC601\uB0B4\uC0DD\uD65C\uC774\uB098 \uAD70\uC0AC\uD6C8\uB828 \uC790\uCCB4\uAC00 \uAC70\uC758 \uBD88\uAC00\uB2A5\uD558\uB2E4. \uC774\uB7EC\uD55C \uC2E0\uCCB4\uC801 \uD2B9\uC9D5\uC758 \uCC28\uC774\uC5D0 \uAE30\uCD08\uD558\uC5EC, \uC785\uBC95\uC790\uAC00 \uCD5C\uC801\uC758 \uC804\uD22C\uB825 \uD655\uBCF4\uB97C \uC704\uD558\uC5EC \uB0A8\uC790\uB9CC\uC744 \uC9D5\uBCD1\uAC80\uC0AC\uC758 \uB300\uC0C1\uC774 \uB418\uB294",
