  "text" : "\uAD6C\uCCB4\uC801\uC73C\uB85C \uAC1C\uAC1C\uC778\uC758 \uC2E0\uCCB4\uC801 \uB2A5\uB825\uC744 \uC218\uCE58\uD654, \uAC1D\uAD00\uD654\uD558\uC5EC \uBE44\uAD50\uD558\uB294 \uAC80\uC0AC\uCCB4\uACC4\uB97C \uAC16\uCD94\uB294 \uAC83\uC740 \uD604\uC2E4\uC801\uC73C\uB85C \uB9E4\uC6B0 \uC5B4\uB835\uB2E4. \uB610\uD55C \uC2E0\uCCB4\uC801 \uB2A5\uB825\uC774 \uB9E4\uC6B0 \uB6F0\uC5B4\uB09C \uC5EC\uC790\uC758 \uACBD\uC6B0\uC5D0\uB3C4 \uADF8 \uC0DD\uB798\uC801 \uD2B9\uC131\uC0C1 \uC6D4\uACBD\uC774 \uC788\uB294 \uB9E4\uC6D4 1\uC8FC\uC77C \uC815\uB3C4\uC758 \uAE30\uAC04 \uB3D9\uC548 \uD6C8\uB828 \uBC0F \uC804\uD22C \uAD00\uB828 \uC5C5\uBB34\uC218\uD589\uC5D0",
