  "text" : "\uADFC\uB825 \uB4F1\uC774 \uC6B0\uC218\uD55C \uB0A8\uC790\uAC00 \uC804\uD22C\uC5D0 \uB354\uC6B1 \uC801\uD569\uD55C \uC2E0\uCCB4\uC801 \uB2A5\uB825\uC744 \uAC16\uCD94\uACE0 \uC788\uB2E4\uACE0 \uD560 \uC218 \uC788\uB2E4. \uBB3C\uB860 \uC9D1\uB2E8\uC73C\uB85C\uC11C\uC758 \uB0A8\uC790\uC640 \uC5EC\uC790\uAC00 \uC544\uB2C8\uB77C \uAC1C\uAC1C\uC778\uC744 \uB300\uC0C1\uC73C\uB85C \uD310\uB2E8\uD558\uB294 \uACBD\uC6B0, \uC5EC\uC790\uAC00 \uB0A8\uC790\uC5D0 \uBE44\uD558\uC5EC \uC804\uD22C\uC5D0 \uC801\uD569\uD55C \uC2E0\uCCB4\uC801 \uB2A5\uB825\uC774 \uC6B0\uC6D4\uD55C \uC0AC\uB840\uAC00 \uC788\uC74C\uC740 \uBD84\uBA85\uD558\uB098,",
