  "text" : "\uD558\uC9C0\uB9CC \uC774 \uACB0\uC815\uC5D0\uC11C \uD5CC\uBC95\uC7AC\uD310\uC18C \uB2E4\uC218\uC758\uACAC\uC740 \"\uC77C\uBC18\uC801\uC73C\uB85C \uC9D1\uB2E8\uC73C\uB85C\uC11C \uB0A8\uC790\uC640 \uC5EC\uC790\uB294 \uC11C\uB85C \uB2E4\uB978 \uC2E0\uCCB4\uC801 \uB2A5\uB825\uC744 \uBCF4\uC720\uD558\uACE0 \uC788\uB2E4\uACE0 \uD3C9\uAC00\uB418\uB294\uB370, \uC804\uD22C\uB97C \uC218\uD589\uD568\uC5D0 \uC788\uC5B4 \uC694\uCCAD\uB418\uB294 \uC2E0\uCCB4\uC801 \uB2A5\uB825\uACFC \uAD00\uB828\uD558\uC5EC \uBCF8\uB2E4\uBA74, \uBB34\uAE30\uC758 \uC18C\uC9C0\u318D\uC791\uB3D9 \uBC0F \uC804\uC7A5\uC758 \uC774\uB3D9\uC5D0 \uC694\uCCAD\uB418\uB294",
