  "text" : "\uADF8\uB7F0 \uBD84\uB4E4\uC774 \uB098\uC911\uC5D0 \uC544\uB4E4\uC774 \uB0B3\uC73C\uBA74, \uADF8 \uC544\uB4E4\uC774 \uC5B4\uB514 \uAC00\uC11C \uC131\uBC94\uC8C4\uB97C \uC800\uC9C0\uB974\uACE0 \uC640\uB3C4 \"\uC6B0\uB9AC \uC560\uAC00 \uBB38\uC81C\uAC00 \uC544\uB2C8\uB77C \uBC24 \uB2A6\uC740 \uC2DC\uAC04\uC5D0 \uC3D8\uB2E4\uB2C8\uACE0, \uC57C\uD558\uAC8C \uC785\uACE0 \uB2E4\uB2C8\uACE0, \uD3C9\uC0C1\uC2DC \uD589\uC2E4\uC774 \uC88B\uC9C0 \uC54A\uB358 \uC0C1\uB300 \uC5EC\uC131\uC774 \uC798\uBABB\uD55C \uAC83\uC774\uB2E4.\" \uB530\uC704\uC758 \uC18C\uB9AC\uB97C \uD560 \uAC83\uC774 \uC790\uBA85\uD558\uC9C0 \uC54A\uC2B5\uB2C8\uAE4C",
