  "text" : "\uC5EC\uD2BC... \uC774\uBC88 \uC0AC\uAC74\uC73C\uB85C \uC778\uD574 \uB178\uB2E4\uC9C0 \uAE08\uAD11\uC774 \uC138\uC0C1\uC5D0 \uBAA8\uC2B5\uC744 \uB4DC\uB7EC\uB0B8 \uAC83 \uC544\uB2C8\uACA0\uC74D\uB2C8\uAE4C.\n\n\uAC4D \uADFC\uCC98 \uC7AC\uB798\uC2DD \uD654\uC7A5\uC2E4\uC5D0 \uAC00\uC11C \uC751\uC544\uB97C \uD37C\uB2E4 \uB2F4\uC740 \uB2E4\uC74C\uC5D0, \uC774\uB97C \uD314\uC544\uB3C4 \uC0AC\uB294 \uC0AC\uB78C\uC774 \uC788\uC9C0 \uC54A\uACA0\uB098... (\uC800 \uD310\uB9E4 \uACFC\uC815\uC5D0\uC11C \uC74C\uB780\uBB3C\uC758 \uC720\uD3EC\uAC00 \uBE60\uC9C4\uB2E4\uBA74 \uD310\uB2E8\uD558\uAE30\uAC00 \uCC38 \uC560\uB9E4)",
