  "text" : "\uD55C\uAD6D\uC73C\uB85C \uB3CC\uC544\uC624\uBA74 \uB2E4\uD589\uC774\uACA0\uC9C0\uB9CC, \uC678\uAD6D\uC5D0\uC11C \uBC84\uD2F0\uACE0 \uBC84\uD2F0\uB2E4\uAC00 \uC5EC\uAD8C\uC774 \uB9CC\uB8CC\uB41C \uC0C1\uD0DC\uC5D0\uC11C\uAE4C\uC9C0 \uADC0\uAD6D\uD558\uC9C0 \uC54A\uACE0 \uBC84\uD2F0\uACE0 \uC788\uB294\uB2E4\uBA74 \uADF8\uAC74 \uB2F9\uC5F0\uD788 \uCCB4\uB958\uAD6D\uC5D0 \uB300\uD55C \"\uBD88\uBC95\uCCB4\uB958\"\uAC00 \uB418\uC8E0. \uADF8\uB7F4 \uACBD\uC6B0\uC5D0\uB294 \uAC15\uC81C\uD1F4\uAC70\uB098 \uCD9C\uAD6D\uBA85\uB839\uC758 \uB300\uC0C1\uC774 \uB418\uBA70, \uADF8 \uC774\uD6C4\uC5D0\uB294 \uC7AC\uC785\uAD6D\uC870\uCC28 \uAC70\uBD80\uB418\uACE0\uC694.",
