  "text" : "\uD574\uC678\uAC70\uC8FC\uC790\uB77C\uACE0 \uD615\uC0AC\uC0C1(\uD639\uC740 \uBBFC\uC0AC) \uACE0\uC18C\uB97C \uBABB\uD55C\uB2E4\uB358\uAC00 \uADF8\uB7F0\uAC74 \uC5C6\uC2B5\uB2C8\uB2E4. \uC77C\uB2E8 \uD604\uC7AC \uB300\uD55C\uBBFC\uAD6D \uAD6D\uC801\uC758 \uBCF4\uC720\uC790\uC778 \uC774\uC0C1, \uC18D\uC778\uC8FC\uC758\uC5D0 \uC758\uD574 \uB2F9\uC5F0\uD788 \uACE0\uC18C \uB300\uC0C1\uC774 \uB418\uC8E0.\n\n\uD55C\uAD6D\uC5D0 \uB3CC\uC544\uC624\uC9C0 \uC54A\uB354\uB77C\uB3C4 \uAE30\uC18C\uC911\uC9C0 \uC0C1\uD0DC\uAC00 \uC720\uC9C0\uAC00 \uB418\uBA70, \uADF8\uB7F4 \uACBD\uC6B0\uC5D0\uB294 \uC5EC\uAD8C \uAC31\uC2E0\uC870\uCC28 \uC548\uB429\uB2C8\uB2E4.",
