  "text" : "\uADF8\uB807\uB2E4\uACE0 \uC81C\uAC00 \uC724\uD6C4 \uC548\uD2F0\uAC00 \uB418\uACA0\uB2E4\uB294 \uAC83\uC740 \uC544\uB2D9\uB2C8\uB2E4. \uC8C4 \uC5C6\uB294 \uC544\uC774\uC758 \uC548\uD2F0\uAC00 \uB420 \uC815\uB3C4\uB85C \uC218\uB77C\uC758 \uAE38\uC744 \uAC77\uACE0 \uC2F6\uC9C0\uB294 \uC54A\uB124\uC694 \u314B\u314B\u314B \uC81C\uAC8C \uC724\uD6C4 \uC548\uD2F0\uCE74\uD398 \uD68C\uC6D0\uB4E4\uC774\uB780, \uC544\uBB34\uC5D0\uAC8C\uB098 \uC2DC\uBE44\uAC78\uACE0 \uC644\uC7A5\uC9C8\uC744 \uD558\uACE0 \uB2E4\uB2C8\uB294 \uC724\uD6C4\uC758 \uADF9\uC131\uD32C\uB4E4 \uB9CC\uD07C\uC774\uB098 \uBCC4 \uC774\uD574\uAC00 \uC548\uAC00\uB294 \uADF8\uB7F0 \uC874\uC7AC",
