  "text" : "\uC800\uB294 TV\uB97C \uAC70\uC758 \uBCF4\uC9C0 \uC54A\uAE30 \uB54C\uBB38\uC5D0, \uC724\uD6C4\uC5D0 \uB300\uD574 \uC544\uB294 \uBC14\uAC00 \uAC70\uC758 \uC5C6\uC5B4\uC694. \uC0AC\uB78C\uB4E4\uC5D0\uAC8C \uC804\uD574 \uB4E3\uAC70\uB098, \uAC00\uB054 \uC778\uD130\uB137\uC5D0\uC11C \uBCF8 \uB3D9\uC601\uC0C1 \uD074\uB9BD \uB4F1\uC744 \uD1B5\uD574 \uBCF8 '\uC798 \uBA39\uB294\uB2E4, \uC21C\uC218\uD558\uB2E4' \uC815\uB3C4\uBC16\uC5D0 \uBAA8\uB974\uC8E0. \uADF8\uB798\uC11C \uC724\uD6C4\uC5D0 \uB300\uD574 \uBB34\uB364\uB364\uD574\uC694. \uC5C4\uBC00\uD788 \uB9D0\uD558\uC790\uBA74 \uAD00\uC2EC\uC774 \uC5C6\uC8E0.",
