  "text" : "\uADF8\uB7EC\uD55C \uC9D1\uB2E8\uC774 \uD2B9\uBCC4\uD788 \uADF8 \uC544\uC774\uC758 \uBA85\uC608\uB97C \uD6FC\uC190\uD55C\uB2E4\uB358\uAC00 \uBAA8\uC695\uC744 \uAC00\uD558\uC9C0 \uC54A\uB294 \uC774\uC0C1\uC740 \uADF8\uC5D0 \uB300\uD55C \uC548\uD2F0\uD32C\uACFC \uC548\uD2F0\uCE74\uD398\uC758 \uC874\uC7AC\uB3C4 \uCDA9\uBD84\uD788 \uC6A9\uB0A9\uD560 \uAC00\uCE58\uAC00 \uC788\uB2E8 \uB9D0\uC785\uB2C8\uB2E4. \"\uBB50 \uC800\uB7F0 \uC0AC\uB78C\uB4E4\uB3C4 \uC788\uAD6C\uB098..\" \uD558\uACE0 \uB9D0\uC774\uC8E0. (\uBB3C\uB860 \uBC94\uC8C4\uC758 \uC694\uAC74\uC744 \uAC16\uCD98\uB2E4\uBA74 \uADDC\uC81C\uB97C \uD574\uC57C\uACA0\uC9C0\uB9CC\uC694)",
