  "text" : "\uB204\uAD70\uAC00\uB97C \uC2EB\uC5B4\uD558\uB294 \uAC83\uB3C4 \uB9C8\uCC2C\uAC00\uC9C0\uB77C\uACE0 \uC0DD\uAC01\uD574\uC694. \uB0B4\uAC00 \uC544\uBB34\uB9AC \uC88B\uC544\uD558\uB294 \uC0AC\uB78C\uC774\uB77C\uB3C4, \uB204\uAD70\uAC00\uB294 \uADF8 \uC0AC\uB78C\uC744 \uC2EB\uC5B4\uD560 \uC218\uB3C4 \uC788\uC5B4\uC694. \uC2EC\uC9C0\uC5B4\uB294 \uADF8 \uC0AC\uB78C\uC774 \uC544\uBB34 \uC8C4\uC5C6\uB294 8\uC0B4 \uC9DC\uB9AC \uC5B4\uB9B0\uC774\uB77C\uACE0 \uD558\uB354\uB77C\uB3C4, \uADF8\uB0E5 \uADF8 \uC544\uC774\uB97C \uC2EB\uC5B4\uD560 \uC218\uB3C4 \uC788\uB294\uAC81\uB2C8\uB2E4. \uC774\uC720\uB294 \uC798 \uBAA8\uB974\uACA0\uC9C0\uB9CC.",
