  "text" : "\uC544\uB2C8 \uB0A8\uC774\uC0AC \uB204\uAD74 \uC88B\uC544\uD558\uACE0 \uC608\uBED0\uD558\uAC74 \uB9D0\uAC74, \uC65C \uAC70\uAE30\uC5D0 \uB2F9\uC2E0\uC758 \uCDE8\uD5A5\uC744 \uB4E4\uC774\uBC00\uC8E0? \uADF8\uB0E5 '\uC544, \uC7E4\uB294 \uADF8\uB7F0 \uD0C0\uC785\uC744 \uC88B\uC544\uD558\uB294\uAD6C\uB098.' \uB77C\uACE0 \uC0DD\uAC01\uD558\uACE0 \uB118\uC5B4\uAC00\uBA74 \uC548\uB3FC\uC694? \uD3C9\uC18C\uC5D0\uB294 \uADF8\uB807\uAC8C \uAC1C\uCDE8\uC640 \uD45C\uD604\uC758 \uC790\uC720\uB97C \uBD80\uB974\uC9D6\uC73C\uBA74\uC11C, \uD0C0\uC778\uC758 \uAC1C\uCDE8\uC640 \uD638\uBD88\uD638\uB294 \uC6A9\uB0A9 \uBABB\uD558\uACA0\uB358\uAC00\uC694?",
