  "text" : "\uADF8\uB798\uC11C \uC81C\uAC00 \uC774\uB7F0 \uC0AC\uB78C\uB4E4\uC744 \uBCC4\uB85C \uB2EC\uAC11\uC9C0 \uC54A\uAC8C \uC5EC\uACBC\uC8E0.\n\n\uB0B4\uAC00 SNS\uC5D0\uB2E4\uAC00 \"\uB098\uB294 ~\uAC00 \uCC38 \uC608\uC05C \uAC83 \uAC19\uC544\" \uB77C\uACE0.\uAE00\uC744 \uC62C\uB838\uB354\uB2C8 \uAC70\uAE30\uB2E4\uAC00 \uAD73\uC774 \"\uB300\uCCB4 \uAC54\uAC00 \uBB50\uAC00 \uC608\uBED0? \uC774\uD574\uB97C \uBABB\uD558\uACA0\uB124. \uC878 \uBABB\uC0DD\uAE30\uC9C0 \uC54A\uC558\uB098\" \uBB50 \uC774\uB7F0 \uC2DD\uC758 \uD53C\uB4DC\uBC31\uC744 \uB0A0\uB824\uC8FC\uC2DC\uB294 \uBD84\uB4E4 \uB9D0\uC774\uC8E0.",
