  "text" : "\uC9C0\uAE08\uAE4C\uC9C0 \uB204\uB204\uC774 \uB9D0\uD574\uC654\uB4EF\uC774.. \uB204\uAD70\uAC00\uAC00 \uD2B9\uC815 \uB300\uC0C1\uC774\uB098 \uD604\uC0C1\uC5D0 \uB300\uD574 \uD638\uBD88\uD638\uB97C \uBC1D\uD614\uC744 \uB54C, \uADF8\uB7EC\uD55C \uD638\uBD88\uD638\uC758 \uD45C\uD604\uC774 \uBA85\uC608\uD6FC\uC190\uC774\uB098 \uBAA8\uC695, \uD639\uC740 \uCC28\uBCC4\uC744 \uC870\uC7A5\uD558\uB294 \uD589\uC704\uAC00 \uB418\uC5B4 \uACB0\uACFC\uC801\uC73C\uB85C \uD0C0\uC778\uC5D0 \uB300\uD55C \uBC95\uC775\uCE68\uD574\uAC00 \uBC1C\uC0DD\uD558\uC9C0 \uC54A\uB294 \uC774\uC0C1\uC740 \uADF8\uAC83\uB3C4 \uC874\uC911\uD574\uC904 \uAC00\uCE58\uAC00 \uC788\uC5B4\uC694.",
