  "text" : "\uC0AC\uB78C\uC774 \uC0B4\uBA74\uC11C \uB204\uAD70\uAC00\uB97C \uC88B\uC544\uD558\uB294 \uAC83\uC5D0 \uD2B9\uBCC4\uD55C \uC774\uC720\uAC00 \uC5C6\uC744.\uC218 \uC788\uB4EF, \uC0AC\uB78C\uC774 \uB204\uAD70\uAC00\uB97C \uC2EB\uC5B4\uD558\uB294 \uAC83\uC5D0\uB3C4 \uD2B9\uBCC4\uD55C \uC774\uC720\uAC00 \uC5C6\uC744 \uC218 \uC788\uC796\uC544\uC694. \uC2EC\uC9C0\uC5B4\uB294 \"\uB098\uB294 \uC800 \uC0AC\uB78C\uC758 \uC9C1\uBAA8(or \uACF1\uC2AC)\uAC00 \uC2EB\uC5B4\" \uB77C\uBA70 \uB204\uAD70\uAC00\uB97C \uC2EB\uC5B4\uD558\uB294 \uC774\uC720\uB97C \uB9CC\uB4DC\uB294 \uC0AC\uB78C\uB4E4\uB3C4 \uC788\uB294\uB370\uC694 \uBB50.",
