  "text" : "\uC544\uC2DC\uB294 \uBD84\uB4E4\uC740 \uC544\uC2DC\uB2E4\uC2DC\uD53C, \uC800\uB294 \uAE40\uC5F0\uC544 \uC120\uC218\uC758 \uAF64 \uC5F4\uB82C\uD55C \uD32C\uC774\uC5D0\uC694. \uADF8\uB0E5 \uC608\uBED0\uC11C \uC5B4\uCA54 \uC904 \uBAB0\uB77C\uD558\uB294, \uADF8\uB7F0 \uC544\uC988\uC528 \uD32C\uC785..\n\n\uADF8\uB7F0 \uC800\uC774\uC9C0\uB9CC, \uAE40\uC5F0\uC544 \uC120\uC218\uB97C \uC2EB\uC5B4\uD558\uB294 \uC0AC\uB78C\uB4E4\uC758 \uC874\uC7AC\uC640 \uC544\uC0AC\uB2E4 \uB9C8\uC624 \uC120\uC218\uB97C \uC88B\uC544\uD558\uB294 \uC0AC\uB78C\uB4E4\uC758 \uC874\uC7AC\uAC00 \uBCC4\uB85C \uC774\uC0C1\uD558\uC9C0\uB294 \uC54A\uC558\uC5C8\uC5B4\uC694.",
