  "text" : "\uBCF4\uD1B5 \uD2B8\uC717\uC5D0\uC11C \uC0C1\uB300\uC758 \uC9C0\uC2DD\uC218\uC900\uC744 \uC774 \uB450\uAC1C\uB85C \uAD6C\uBD84\uD558\uC9C0 \uC54A\uB098?\n\n\uBABB\uC6E0\uAC70\uB098 \/ \uD639\uC740 \uD5DB\uBC30\uC6E0\uAC70\uB098.\n\n\uC0C1\uB300\uAC00 \uB098\uBCF4\uB2E4 \uD559\uB825\uC774 \uB0AE\uC73C\uBA74 \uADF8\uB0E5 \uBABB\uBC30\uC6CC\uC11C \uADF8\uB7F0 \uAC78\uB85C \uCE58\uACE0, \uC0C1\uB300\uAC00 \uB098\uBCF4\uB2E4 \uD559\uB825\uC774 \uB192\uB354\uB77C\uB3C4 \uB0B4 \uB9C8\uC74C\uC5D0 \uC548\uB4E4\uBA74 \uD5DB\uBC30\uC6B4 \uAC83\uC73C\uB85C \uCE58\uBD80\uD574 \uBC84\uB9AC\uBA74 \uB418\uB2C8 \uD3B8\uD558\uAD6C\uB9C8?",
