  "text" : "\uAD73\uC774 \uC5B4\uB9B0\uC560 \uC548\uD2F0\uAE4C\uD398\uAE4C\uC9C0 \uB9CC\uB4E4\uC5B4\uAC00\uBA70 \uC4F8\uB370\uC5C6\uC774 \uBCD1\uC2E0\uB825\uC744 \uC3DF\uB294 \uC560\uB4E4\uC774\uB098, \uC548\uD2F0\uB97C \uC548\uD2F0\uD55C\uB2E4\uBA70- \uC598\uB97C \uC5B4\uB5BB\uAC8C \uC2EB\uC5B4\uD560 \uC218 \uC788\uB0D0\uBA70 \uC544\uBB34\uB370\uB098 \uC55E\uB4A4 \uC548\uAC00\uB9AC\uACE0 \uBED8\uC2DC\uBE44\uAE00 \uC2F8\uC9C0\uB974\uACE0 \uB2E4\uB2C8\uB294 \uC560\uB4E4 \uC0AC\uC774\uC5D0\uB294 \uB098\uB984 \uD1B5\uD558\uB294 \uBD80\uBD84\uC774 \uC788\uB294 \uB4EF \uC2F6\uB2E4. \uC6D0\uB798 \uADF9\uACFC \uADF9\uC740 \uD1B5\uD55C\uB314\uB2E4\uACE0.",
