  "text" : "\uC548\uD2F0\uB97C \uC548\uD2F0\uD558\uB294 \uBD84\uB4E4\uC5D0\uAC8C \uC5BC\uB77C\uC774 \uC548\uD574\uC92C\uB2E4\uACE0 \uC548\uD2F0\uC548\uD2F0\uC5B4\uB4E4\uC5D0\uAC8C \uC548\uD2F0\uB97C \uB2F9\uD588\uC74D\uB2C8\uB2E4. \uC774\uAC8C \uB2E4 \uBD80\uBAA8\uB97C \uC798\uBABB \uB9CC\uB09C \uC81C \uC798\uBABB \uC544\uB2C8\uACA0\uC74D\uB2C8\uAE4C \u3160 \uBD80\uB7EC\uC6CC\uC5EC, \uC88B\uC740 \uBD80\uBAA8\uB2D8\uC744 \uB9CC\uB098 \uC0AC\uB791\uBC1B\uACE0 \uD070 \uB355\uC5D0 \uC775\uBA85\uC73C\uB85C \uB0A8\uC5D0\uAC8C \uC0C1\uCC98\uB97C \uC8FC\uC9C0 \uB9D0\uB77C\uBA70 \uC775\uBA85\uC73C\uB85C \uC0C1\uCC98\uB97C \uC8FC\uC2E4 \uC218 \uC788\uB294 \uBD84\uB4E4\u3160",
