  "text" : "\uD0C0\uACE0 \uC788\uB358 \uCC28\uB7C9\uC774 \uAC11\uC790\uAE30 \uC5C4\uCCAD\uB09C \uAD49\uC74C\uACFC \uD568\uAED8 \uD06C\uAC8C \uC694\uB3D9\uCCE4\uACE0, \uC0AC\uD0DC \uD30C\uC545\uC774 \uB418\uC9C0 \uC54A\uC740 \uB098\uB294 \uC7A0\uC2DC \uD63C\uBE44\uBC31\uC0B0.\n\n\uADF8\uB7EC\uB2E4\uAC00 \uC815\uC2E0\uC744 \uC880 \uCC28\uB9B0 \uB4A4\uC5D0 \uC606\uC744 \uBD24\uB294\uB370.. \uBC29\uAE08\uC804\uAE4C\uC9C0 \uB0B4\uAC00 \uC549\uC544\uC788\uB358 \uC790\uB9AC\uAC00 \uAC70\uC758 \uC950\uB72F\uACA8 \uB098\uAC00\uB4EF\uC774 \uBB49\uAC1C\uC838 \uC0AC\uB77C\uC9C0\uACE0 \uC5C6\uC5C8\uB2E4.",
