  "text" : "\uADF8\uB7F0\uB370 \uB0B4\uAC00 \uD560 \uC218 \uC788\uB294 \uAC83\uC774 \uBB50\uAC00 \uC788\uACA0\uB098. \uADF8\uC800 \uC549\uC544\uC788\uB358 \uC790\uB9AC\uB9CC \uBC97\uC5B4\uB098\uB294 \uC218\uBC16\uC5D0. \uB9C8\uCE68 \uBC18\uB300\uD3B8 \uCC28\uC120 \uAD6C\uACBD\uC5D0\uB3C4 \uC9C8\uB824\uC788\uC5C8\uAE30\uC5D0, \uB098\uB294 \uCD5C\uD6C4\uBC29\uC88C\uC11D \uC6B0\uCE21 \uC88C\uC11D\uC73C\uB85C \uC790\uB9AC\uB97C \uC62E\uACBC\uB2E4. \uADF8\uB9AC\uACE0\uB294 \uBCC4 \uC0DD\uAC01 \uC5C6\uC774 \uC548\uC804\uBCA8\uD2B8\uAE4C\uC9C0 \uCC29\uC6A9\uD558\uACE0 \uB098\uC11C \uCC3D\uBC16\uC744 \uAD6C\uACBD\uD558\uAE30 \uC2DC\uC791\uD588\uB294\uB370..",
