  "text" : "\uADF8\uB807\uAC8C \uC7A0\uC5D0\uC11C \uAE6C \uB098\uB294, \uC2B9\uD569\uCC28 \uCD5C\uD6C4\uBC29\uC88C\uC11D \uC88C\uCE21\uD3B8\uC5D0 \uC549\uC544 \uC0DD\uC804 \uCC98\uC74C \uBCF4\uB294 \uB2E4\uB978 \uB3C4\uC2DC\uB97C \uAD6C\uACBD\uD558\uAE30 \uC2DC\uC791\uD588\uB2E4. \uAC74\uBB3C\uB4E4\uACFC \uC9C0\uB098\uAC00\uB294 \uCC28\uB7C9\uB4E4 \uB4F1\uB4F1..\n\n\uADF8\uB7F0\uB370 \uB610\uB2E4\uC2DC \uADF8 \uB290\uB08C\uC774 \uC624\uAE30 \uC2DC\uC791\uD588\uB2E4. \uD558\uB358 \uD589\uB3D9\uC744 \uBA48\uCD94\uACE0 \uB2F9\uC7A5\uC774\uB77C\uB3C4 \uC5EC\uAE30\uC11C \uBC97\uC5B4\uB098\uC57C \uD560 \uAC83 \uAC19\uC740 \uADF8\uB7F0 \uB290\uB08C",
