  "text" : "\uADF8\uB807\uAC8C \uC798 \uC790\uACE0 \uC788\uB294\uB370, \uAC11\uC790\uAE30 \uAE68\uBC84\uB838\uB2E4. \uB204\uAD70\uAC00\uAC00 \uB098\uB97C \uAE68\uC6B4 \uAC83\uB3C4 \uC544\uB2C8\uACE0, \uBC16\uC5D0\uC11C \uC2DC\uB044\uB7EC\uC6B4 \uC18C\uB9AC\uAC00 \uB09C \uAC83\uB3C4 \uC544\uB2CC\uB370 \uC5B4\uCA4C\uB2E4\uBCF4\uB2C8 \uAE68\uBC84\uB838\uB2E4. \uC544\uB2C8, \uAE68\uC5B4\uB098\uC57C\uB9CC \uD55C\uB2E4\uB294 \uB290\uB08C\uC744 \uBC1B\uC558\uB358 \uAC83 \uAC19\uB2E4. \uC608\uC758 \uADF8 \uB048\uC801\uB048\uC801\uD558\uACE0 \uC12C\uB729\uD55C \uBD88\uC548\uAC10\uACFC \uD568\uAED8 \uB9D0\uC774\uC9C0.",
