  "text" : "\uC5D0\uC0C1\uB300\uB85C \uC2B9\uD569\uCC28 \uC548\uC740 \uBB34\uCC99\uC774\uB098 \uC9C0\uB8E8\uD588\uACE0.. \uC6B4\uC804\uB300\uB97C \uC7A1\uAC8C \uB41C \uC544\uBC84\uC9C0\uC640 \uC870\uC218\uC11D\uC5D0 \uC549\uC544\uACC4\uC2E0 \uC5B4\uBA38\uB2C8, \uADF8\uB9AC\uACE0 \uB0B4\uAC00 \uC798 \uBAA8\uB974\uB294 \uC5B4\uB978\uB4E4\uC758 \uB300\uD654\uC5D0\uC11C \uBA40\uCC0C\uAC10\uCE58 \uB5A8\uC5B4\uC9C4 \uB098\uB294 \uC2B9\uD569\uCC28 \uB4B7\uC88C\uC11D\uC5D0 \uBAA8\uB85C \uB204\uC6CC \uC790\uAE30 \uC2DC\uC791\uD588\uB2E4. \uB098\uB294 \uC774\uC0C1\uD558\uAC8C \uCC28\uC5D0 \uD0C0\uBA74 \uC7A0\uC774 \uC798 \uC624\uB354\uB77C\uAD6C.",
