  "text" : "\uC798 \uBAA8\uB974\uB294 \uC5B4\uB978\uB4E4\uC758 \uD2C8\uC5D0 \uB07C\uC5B4 \uC549\uC544\uC788\uAE30\uB294 \uC5EC\uAC04 \uACE0\uD1B5\uC2A4\uB7EC\uC6B4 \uC77C\uC774 \uC544\uB2C8\uC5C8\uACE0, \uADF8\uB798\uC11C \uB098\uB294 \uC0AC\uB78C\uC774 \uC880 \uB35C \uD0C4 \uC2B9\uD569\uCC28\uC758 \uB4B7\uC790\uC11D\uC744 \uC120\uD0DD\uD588\uB2E4. '\uC606\uC88C\uC11D\uB3C4 \uBAA8\uB450 \uBE44\uC5B4\uC788\uC73C\uB2C8, \uCC28\uB97C \uD0C0\uACE0 \uAC00\uB2E4\uAC00 \uC878\uB9AC\uBA74 \uC606\uC73C\uB85C \uB204\uC6CC\uC11C \uC790\uC57C\uC9C0' \uB77C\uB294 \uC2EC\uC0B0\uC73C\uB85C \uB9D0\uC774\uB2E4.",
