  "text" : "\uAE30\uC5B5\uC774 \uAC00\uBB3C\uAC00\uBB3C\uD55C\uB370.. \uBD80\uBAA8\uB2D8 \uCE5C\uAD6C\uBD84 \uC790\uC81C \uD639\uC740 \uBA3C \uCE5C\uCC99\uC758 \uACB0\uD63C\uC2DD\uC5D0 \uCC38\uC11D\uD558\uB7EC \uAC00\uB358 \uAE38\uC774\uC5C8\uB2E4. \uD568\uAED8 \uAC00\uAE30\uB85C \uD55C.\uC0AC\uB78C\uC774 \uB098\uB97C \uD3EC\uD568\uD574\uC11C 12\uBA85\uC774\uC5C8\uAE30 \uB54C\uBB38\uC5D0, \uC5B4\uB978\uB4E4\uAED8\uC11C\uB294 \uCC28\uB97C \uC5EC\uB7EC\uB300 \uAC00\uC838\uAC00\uAE30 \uBCF4\uB2E4\uB294 \uC2B9\uD569\uCC28\uB97C \uB450\uB300 \uB80C\uD2B8\uD574\uC11C \uAC19\uC774 \uD0C0\uACE0 \uAC00\uAE30\uB85C \uD588\uB2E4.",
