  "text" : "\uACB0\uAD6D \uC544\uC774\uC758 \uC2DC\uC2E0\uC740 \uACE0\uBB34\uBCF4\uD2B8\uB97C \uD0C4 \uAD6C\uC870\uB300\uC5D0 \uC758\uD574 \uC778\uC591\uB428..\n\n\uAD6C\uACBD\uB098\uC628 \uB9C8\uC744\uC0AC\uB78C\uB4E4\uC758 \uC774\uC57C\uAE30\uC5D0 \uC758\uD558\uBA74, \uADF8 \uC9C0\uC810\uC774 \uC720\uB09C\uD788 \uC775\uC0AC\uC0AC\uACE0\uAC00 \uC7A6\uC740 \uC9C0\uC810\uC774\uACE0, \uC544\uBB34\uB9AC \uCC3E\uC544\uB3C4 \uCC3E\uC744 \uC218 \uC5C6\uB358 \uC2DC\uC2E0\uC774 \uD558\uB8E8 \uC815\uB3C4 \uC9C0\uB098\uBA74 \uADF8 \uC9C0\uC810\uC5D0\uC11C \uB2E4\uC2DC \uB5A0\uC624\uB974\uB294\uB370, \uD56D\uC0C1 \uC800\uB807\uAC8C \uC11C\uC788\uB2E4\uACE0.",
