  "text" : "\uBB38\uC81C\uC9D1\uC744 \uC774\uAC83\uC800\uAC83 \uB298\uB9AC\uC9C0 \uC54A\uACE0, \uC774\uBBF8 \uD47C \uBB38\uC81C\uC9D1\uC744 \uB610 \uD480\uACE0 \uB610 \uD480\uBA74\uC11C \uC810\uC810 \uC591\uC744 \uC904\uC5EC\uB098\uAC14\uC74C. \uADF8\uB9AC\uACE0 \uAD50\uC7AC\uC5D0 \uD615\uAD11\uD39C \uB4F1\uC758 \uC0C9\uAE54 \uB9C8\uD0B9\uC740 \uAC00\uB2A5\uD55C \uD558\uC9C0 \uB9D0\uACE0, \uC2DC\uD5D8\uC774 \uCF54\uC55E\uC5D0 \uB2E5\uCCE4\uC744 \uB54C\uAE4C\uC9C0\uB3C4 \uBAA8\uB974\uACA0\uB294 \uBD80\uBD84\uC5D0\uB2E4\uAC00\uB9CC \uD569\uB2C8\uB2E4 #\uC790\uC2E0\uC758_\uC785\uC2DC\uC804\uB7B5\uC744_\uACE0\uC0BC\uB4E4\uC5D0\uAC8C_\uC598\uAE30\uD574\uC8FC\uC790",
