  "text" : "\uC774\uB807\uAC8C \uB300\uBD80\uBD84\uC758 \uD30C\uC77C\uACF5\uC720\uC11C\uBE44\uC2A4\uAC00 \uB2E4\uC6B4\uB85C\uB4DC\uC640 \uD568\uAED8 '\uC720\uD3EC'\uAE4C\uC9C0 \uC801\uC6A9\uB420 \uAC00\uB2A5\uC131\uC774 \uC544\uC8FC \uB192\uC74C. \uB530\uB77C\uC11C \uC55E\uC73C\uB85C \uC800\uC791\uAD8C \uCE68\uD574\uD589\uC704 \uC548\uC804\uC9C0\uB300\uB294 \uAE30\uB300\uD558\uC9C0 \uC54A\uC73C\uC2DC\uB294 \uAC83\uC774 \uC88B\uC2B5\uB2C8\uB2E4. \uAC4D \uAD6C\uAE00 \uD50C\uB808\uC774 \uC2A4\uD1A0\uC5B4 \uB4F1\uC5D0\uC11C 1,000~2,000\uC6D0 \uB0B4\uACE0 \uB9D8 \uD3B8\uD558\uAC8C \uB300\uC5EC\uD574\uC11C \uBCF4\uC138\uC694.",
