  "text" : "\uADF8\uB9AC\uB4DC \uB51C\uB9AC\uBC84\uB9AC\uAC00 \uBB50\uB0D0\uBA74.. \uC27D\uAC8C \uB9D0\uD574 \uC0AC\uC6A9\uC790 \uAC1C\uAC1C\uC778\uC758 \uC2DC\uC2A4\uD15C\uC744 \uC791\uC740 \uC11C\uBC84\uB85C\uC368 \uD65C\uC6A9\uD558\uB294 \uBC29\uC2DD\uC778\uB370, \uC6F9\uD558\uB4DC \uB2E4\uC6B4\uB85C\uB354 \uD504\uB85C\uADF8\uB7A8\uC744 \uC124\uCE58\uD558\uBA74 \uC774 \uAE30\uB2A5\uC774 \uD568\uAED8 \uC124\uCE58\uAC00 \uB418\uB294 \uACBD\uC6B0\uAC00 \uB9CE\uC74C. \uADF8\uB9AC\uACE0 \uC0AC\uC6A9\uC790\uC758 \uCEF4\uD4E8\uD130\uB294 \uB098\uC058\uAC8C \uB9D0\uD558\uBA74 '\uC880\uBE44PC'\uAC00 \uB418\uC5B4 \uC11C\uBC84\uB85C \uD65C\uC6A9\uB428.",
